import React from 'react';

export default class Tableau extends React.Component {
   render() {
      return (
        <ul>
               {this.props.items.map(item => (
                 <li key={item.id}>{item.text1 + " " + item.text2}</li>
               ))}
             </ul>
      )
   }
}
